import React from 'react';
import {  Link } from "react-router-dom";

const NavBar= () =>{
  return (
  <div>
    <li>
      <Link to="/">Home</Link>
    </li>
    <li>
      <Link to="/about">About</Link>
    </li>
    <li>
      <Link to="/products">Products</Link>
    </li>
  </div>
  );
}

export default NavBar;
